};

/**
 *
 * @param {string} token
 * @returns {object} verifiedToken
 */
export const verifyToken = (token) => {
  const verifiedToken = jwt.verify(token, process.env.JWT_SECRET, {
    expiresIn: '24h'
  });
  return verifiedToken;
};

